          type="text"
          onChange={(e) => {
            const newTerm = e.target.value;
            setSearchTerm(newTerm);
            searchproject(newTerm);
          }}
        />
        <button
          onClick={() => {
            searchproject(searchTerm);
          }}
        >
          search
        </button>
        <Nav className="ml-auto" navbar>
          <Nav.Link
            onClick={() => {
              navigate("/profile");
            }}
          >
            Profile
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default NavBar;
